import React, { useEffect, useState } from "react";
import fetchData from "./fetchData";
import "./Gallary.css";
import Card1 from "../../components/card1";

const Gallary = ({ callback }) => {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function gettingTheData() {
      const theData = await fetchData();
      console.log(theData);
      setData([...theData]);
    }
    gettingTheData();
  }, []);


  function getRandomCat() {
    fetch('https://aws.random.cat/meow')
      .then(res => res.json())
      .then(data => {
        cat_result.innerHTML = `<img src=${data.file} alt="cat" />`
      });
  }

  return (
    <div className="all-countries-card-layout">
      {data.length > 0 &&
        data.map((message) => <Card1 key={message.id} message={message.message} callback={callback} />)}
    </div>
  );
};

export default Gallary;
